import Lightbox from 'react-lightbox-component';

function GalleryLightbox(props) {
    return(
        <div>
            <Lightbox images={
            [
                {
                src: 'some image url',
                title: 'image title',
                description: 'image description'
                }
            ]
            }/>
        </div>
    )
};

export default GalleryLightbox;
